import React from 'react';
import './App.css';
import ClothingDisplayContainer from './components/clothingDisplayContainer/ClothingDisplayContainer';
import FilterContainer from './components/filterContainer/filterContainer';

function App() {
  return (
    <div className="App">
      <div>
        <FilterContainer />
        <ClothingDisplayContainer />
      </div>
    </div>
  )
}

export default App;
